import React from 'react';

const Accessibility = () => {
  return (
    <section id="accessibility" className="py-20 bg-neutral-900">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-16 animate__animated animate__fadeIn">
          <h2 className="text-4xl font-bold text-white mb-4">Accessibility Features</h2>
          <p className="text-gray-400 text-lg">Detailed accessibility information and facilities for differently-abled travelers at every destination.</p>
        </div>
        {/* Additional content related to accessibility features can be added here */}
      </div>
    </section>
  );
};

export default Accessibility;
